import React from 'react';

import './styles'

// JSX - JavaScript XML
// Compomente: Funcao JS que retorna HTML
// Passar atributo para um componente -> propriedade
function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>
    </div>
  );
}

export default App;
